Styles = {
  fontSize: 50,
  textDecorationColor: "lightskyblue",
  textDecorationStyle: "dashed",
  alignItems: "center",
};

class Navbar extends Component {
  render() {
    console.log("NavBar Rendered");
    return (
      <nav class="navbar navbar-dark bg-primary">
        <div style={this.Styles} className="container-fluid f4 bold center mw6">
          Counter with React Js
        </div>
        <a className="navbar-brand " href="https://github.com/alisafdar53">
          <span
            className="bg m-4 rounded-pill bg-info"
            style={{ fontStyle: "italic" }}
          >
            Total Count = {this.props.totalCounters}
          </span>
        </a>
      </nav>
    );
  }
}

export default Navbar;
